import { Fragment } from 'react';
import Header from '../src/components/Layout/Header'
import Meals from './components/Meals/Meals';
import { Cart } from './components/Cart/Cart';
function App() {
  return (
    <Fragment>
      <Cart></Cart>
    <div>
      <Header></Header>
    </div>
    <main>
      <Meals></Meals>
    </main>
    </Fragment>
  );
}

export default App;
